import numpy as np
from itertools import permutations

def evaluate_rank_correlation(metric1, metric2):
    """
    Computes Spearman's rank correlation and Kendall's tau correlation.
    
    Spearman's correlation (https://en.wikipedia.org/wiki/Spearman%27s_rank_correlation_coefficient)
    measures the strength and direction of the monotonic relationship between two variables.
    
    Kendall's tau (https://en.wikipedia.org/wiki/Kendall_rank_correlation_coefficient)
    is a measure of ordinal association between two variables.
    
    Interpretation:
        - Values close to 1 indicate strong positive correlation (similar rankings).
        - Values close to -1 indicate strong negative correlation (opposite rankings).
        - Values near 0 indicate little to no correlation.
        - The p-value indicates statistical significance (typically < 0.05 means significant correlation).
    
    Parameters:
        metric1 (list or np.array): Scores of systems using the first metric.
        metric2 (list or np.array): Scores of systems using the second metric.
    
    Returns:
        tuple: (Spearman correlation coefficient, Spearman p-value,
               Kendall's tau coefficient, Kendall p-value)
    """
    import scipy.stats as stats
    # Compute Spearman's Rank Correlation
    spearman_corr, spearman_p = stats.spearmanr(metric1, metric2)
    
    # Compute Kendall's Tau
    kendall_tau, kendall_p = stats.kendalltau(metric1, metric2)
    
    return spearman_corr, spearman_p, kendall_tau, kendall_p

def permutation_test(metric1, metric2, num_permutations=10000):
    """
    Performs a permutation test to assess whether the rankings of the two metrics are significantly different.
    
    The test shuffles one metric multiple times and computes mismatches to determine a p-value.
    
    Reference: https://en.wikipedia.org/wiki/Resampling_(statistics)#Permutation_tests
    
    Interpretation:
        - If the p-value is small (< 0.05), it suggests that the rankings of the two metrics differ significantly.
        - A high p-value (>= 0.05) suggests that the rankings are similar under random permutations.
        - The number of mismatches provides an intuitive measure of ranking disagreement.
    
    Parameters:
        metric1 (list or np.array): Scores of systems using the first metric.
        metric2 (list or np.array): Scores of systems using the second metric.
        num_permutations (int): Number of permutations to run (default: 10000).
    
    Returns:
        tuple: (Observed ranking mismatches, p-value of the permutation test)
    """
    observed_mismatch = np.sum(np.argsort(metric1) != np.argsort(metric2))
    
    count = 0
    for _ in range(num_permutations):
        permuted_metric2 = np.random.permutation(metric2)
        permuted_mismatch = np.sum(np.argsort(metric1) != np.argsort(permuted_metric2))
        if permuted_mismatch >= observed_mismatch:
            count += 1
    
    p_value = count / num_permutations
    return observed_mismatch, p_value



from itertools import combinations

def discordant_pairs(metric1_scores, metric2_scores):
    """Count the number of discordant pairs (where metric1 ranks A higher than B, but metric2 ranks B higher than A)."""
    
    metric1_ranks = np.argsort(np.argsort(metric1_scores))
    metric2_ranks = np.argsort(np.argsort(metric2_scores))

    # Count discordant pairs
    discordant_count = 0
    total_pairs = 0

    for (i, j) in combinations(range(len(metric1_ranks)), 2):
        if (metric1_ranks[i] - metric1_ranks[j]) * (metric2_ranks[i] - metric2_ranks[j]) < 0:
            discordant_count += 1
        total_pairs += 1

    discordant_ratio = discordant_count / total_pairs

    print(f"Proportion of discordant pairs: {discordant_count}/{total_pairs}={discordant_ratio:.4f}")
    
    from rbo import rbo

    # Convert scores into sorted ranking lists
    metric1_ranking = np.argsort(-(np.array(metric1_scores))).tolist()
    metric2_ranking = np.argsort(-(np.array(metric2_scores))).tolist()

    # Compute RBO (p=0.9 gives higher weight to top ranks)
    rbo_score = rbo.RankingSimilarity(metric1_ranking, metric2_ranking)
    
    print(f"RBO Score: {rbo_score.rbo(p=0.9):.4f}")
    
def permutation_test_for_kendall_tau(metric1_scores, metric2_scores):
    import numpy as np
    from scipy.stats import kendalltau

    # Generate synthetic rankings
    np.random.seed(42)

    metric1_ranks = np.argsort(np.argsort(metric1_scores))
    metric2_ranks = np.argsort(np.argsort(metric2_scores))

    # Compute observed Kendall's Tau
    tau_observed, _ = kendalltau(metric1_ranks, metric2_ranks)

    # Permutation test
    num_permutations = 10000
    tau_permuted = np.zeros(num_permutations)

    for i in range(num_permutations):
        permuted_ranks = np.random.permutation(metric2_ranks)
        tau_permuted[i], _ = kendalltau(metric1_ranks, permuted_ranks)

    # Compute p-value (two-tailed test)
    p_value = np.mean(np.abs(tau_permuted) >= np.abs(tau_observed))

    print(f"Observed Kendall's Tau: {tau_observed:.4f}")
    print(f"P-value (permutation test): {p_value:.4e}")

    if p_value < 0.05:
        print("There is significant evidence that the rankings differ.")
    else:
        print("No significant difference detected between rankings.")





def visualize_ranking(metric1, metric2, labels):
    """
    Creates a scatter plot comparing the rankings of systems under two different metrics.
    
    Reference: https://en.wikipedia.org/wiki/Ranking
    
    Interpretation:
        - Points close to the diagonal indicate similar rankings.
        - Large deviations from the diagonal suggest ranking disagreements.
        - Annotating the points helps identify which systems are ranked differently.
    
    Parameters:
        metric1 (list or np.array): Scores of systems using the first metric.
        metric2 (list or np.array): Scores of systems using the second metric.
        labels (list): Names of the systems being compared.
    
    Returns:
        None (displays the plot)
    """
    import matplotlib.pyplot as plt
    
    rank1 = np.argsort(np.argsort(metric1))
    rank2 = np.argsort(np.argsort(metric2))
    
    plt.figure(figsize=(8, 6))
    plt.scatter(rank1, rank2)
    for i, label in enumerate(labels):
        plt.text(rank1[i], rank2[i], label, fontsize=12)
    plt.xlabel("Ranking by Metric 1")
    plt.ylabel("Ranking by Metric 2")
    plt.title("Comparison of Rankings")
    plt.show()
    


def max_metric_difference(weights):
    """Compute max difference between u-acc and w-acc for the same system."""
    
    weights = sorted(weights)
    n = len(weights)
    total_weight = sum(weights)
    
    max_diff = 0
    muk=0
    mwk=0
    best_predictions = []
    
    # Compute prefix sums for efficiency
    prefix_sums = [0] * (n + 1)
    for i in range(n):
        prefix_sums[i + 1] = prefix_sums[i] + weights[i]
    
    # Try selecting the k smallest elements
    for k in range(1, n + 1):
        U_k = k / n
        W_k = prefix_sums[k] / total_weight
        diff = abs(U_k - W_k)
        if diff > max_diff:
            max_diff = diff
            muk=U_k
            mwk=W_k
            best_predictions = [1] * k + [0] * (n - k)
    
    # Try selecting the k largest elements
    for k in range(1, n + 1):
        U_k = k / n
        W_k = (total_weight - prefix_sums[n - k]) / total_weight
        diff = abs(U_k - W_k)
        if diff > max_diff:
            max_diff = diff
            muk=U_k
            mwk=W_k
            best_predictions = [0] * (n - k) + [1] * k
    
    # Print the best predictions that maximize the metric difference
    print(f"Max difference: {max_diff}")
    print(f"uniform acc: {muk:.4f}, weighted acc: {mwk:.4f}")
#    print("Best predictions and corresponding weights:")
#    print(zip(best_predictions,weights))
#    for pred, weight in zip(best_predictions, weights):
#        print(f"Prediction: {pred}, Weight: {weight}")
    
    return max_diff


    
    
